import React, { useState } from 'react';
import { CheckCircle, XCircle, MinusCircle } from 'lucide-react';
import { saveFontScore } from '../services/api';

const FontRecommendations = ({ recommendations, prompt, onScoreSaved }) => {
    const [scoredFonts, setScoredFonts] = useState(new Set());
    const [loading, setLoading] = useState({});

    const handleScore = async (font, score) => {
        if (scoredFonts.has(font.md5)) return;

        setLoading(prev => ({ ...prev, [font.md5]: true }));

        try {
            await saveFontScore(prompt, font, score);
            setScoredFonts(prev => new Set([...prev, font.md5]));
            onScoreSaved && onScoreSaved(font, score);
        } catch (error) {
            console.error('Error saving score:', error);
        } finally {
            setLoading(prev => ({ ...prev, [font.md5]: false }));
        }
    };

    const getScoreButton = (font, score, icon, color, label) => (
        <button
            onClick={() => handleScore(font, score)}
            disabled={scoredFonts.has(font.md5) || loading[font.md5]}
            className={`
        flex items-center gap-2 px-3 py-2 rounded-md text-sm font-medium transition-all duration-200
        ${scoredFonts.has(font.md5)
                    ? 'bg-gray-100 text-gray-500 cursor-not-allowed'
                    : `${color} hover:scale-105 transform`
                }
      `}
        >
            {icon}
            {label}
            {loading[font.md5] && (
                <div className="w-4 h-4 border-2 border-current border-t-transparent rounded-full animate-spin"></div>
            )}
        </button>
    );

    return (
        <div className="p-6">
            <h3 className="text-xl font-semibold text-gray-800 mb-4">
                Recommendations for: "{prompt}"
            </h3>
            <div className="space-y-4">
                {recommendations.map((font, index) => (
                    <div
                        key={font.md5}
                        className={`
              bg-white rounded-lg p-4 border transition-all duration-200
              ${scoredFonts.has(font.md5)
                                ? 'border-green-200 bg-green-50'
                                : 'border-gray-200 hover:border-primary-300'
                            }
            `}
                    >
                        <div className="flex justify-between items-start mb-3">
                            <div className="flex-1">
                                <h4 className="text-lg font-semibold text-gray-900">
                                    {font.family_name}
                                </h4>
                                <p className="text-sm text-gray-600">{font.style_name}</p>
                                <p className="text-xs text-gray-500">Foundry: {font.foundry_name}</p>
                            </div>
                            <div className="text-right">
                                <div className="text-sm font-medium text-gray-700">
                                    Score: {font.score.toFixed(1)}
                                </div>
                                <div className="text-xs text-gray-500">
                                    Conversion: {font.conversion.toLocaleString()}
                                </div>
                            </div>
                        </div>

                        <div className="mb-3">
                            <div className="flex flex-wrap gap-2 mb-2">
                                {font.classification.map((tag, idx) => (
                                    <span
                                        key={idx}
                                        className="px-2 py-1 bg-blue-100 text-blue-800 text-xs rounded-full"
                                    >
                                        {tag}
                                    </span>
                                ))}
                            </div>
                            <div className="flex flex-wrap gap-2">
                                {font.visualProperty.map((prop, idx) => (
                                    <span
                                        key={idx}
                                        className="px-2 py-1 bg-purple-100 text-purple-800 text-xs rounded-full"
                                    >
                                        {prop}
                                    </span>
                                ))}
                            </div>
                        </div>

                        {font.advanced_tags && font.advanced_tags.length > 0 && (
                            <div className="mb-3">
                                <div className="text-xs text-gray-600 mb-1">Advanced Tags:</div>
                                <div className="flex flex-wrap gap-1">
                                    {font.advanced_tags.map((tag, idx) => (
                                        <span
                                            key={idx}
                                            className="px-2 py-1 bg-green-100 text-green-800 text-xs rounded-full"
                                        >
                                            {tag}
                                        </span>
                                    ))}
                                </div>
                            </div>
                        )}

                        {scoredFonts.has(font.md5) ? (
                            <div className="flex items-center gap-2 text-green-600">
                                <CheckCircle size={16} />
                                <span className="text-sm font-medium">Scored</span>
                            </div>
                        ) : (
                            <div className="flex gap-2">
                                {getScoreButton(
                                    font,
                                    'good',
                                    <CheckCircle size={16} />,
                                    'bg-green-500 hover:bg-green-600 text-white',
                                    'Good Match'
                                )}
                                {getScoreButton(
                                    font,
                                    'average',
                                    <MinusCircle size={16} />,
                                    'bg-yellow-500 hover:bg-yellow-600 text-white',
                                    'Average Match'
                                )}
                                {getScoreButton(
                                    font,
                                    'bad',
                                    <XCircle size={16} />,
                                    'bg-red-500 hover:bg-red-600 text-white',
                                    'Bad Match'
                                )}
                            </div>
                        )}
                    </div>
                ))}
            </div>
        </div>
    );
};

export default FontRecommendations;
